import React from 'react';
import spinner from './spinner.gif';

export default () => {
  <Fragment>
    <img
      src={spinner}
      style={{ sidth: '200px', margin: 'auto', display: 'block' }}
      alt='Loading...'
    />
  </Fragment>;
};
